// 内联图标组件
export const XzxIcon = {
  name: 'XzxIcon',
  props: {
    name: {
      type: String,
      required: true
    },
    size: {
      type: [String, Number],
      default: '1em'
    },
    color: {
      type: String,
      default: 'currentColor'
    },
    fillColor: {
      type: String,
      default: null
    }
  },
  render(h) {
    const icon = iconData[this.name]
    if (!icon) {
      console.warn(`Icon "${this.name}" not found`)
      return null
    }

    // 构建样式对象
    const svgStyle = {
      verticalAlign: 'middle',
      display: 'inline-block'
    }

    // 设置颜色 - 优先使用color作为整体颜色
    if (this.color) {
      svgStyle.color = this.color
    }

    return h('svg', {
      attrs: {
        class: 'xzx-icon',
        width: this.size,
        height: this.size,
        viewBox: icon.viewBox,
        fill: this.fillColor || 'none',
        xmlns: 'http://www.w3.org/2000/svg',
        'aria-hidden': true
      },
      style: svgStyle,
      domProps: {
        innerHTML: icon.content
      }
    })
  }
}

// 安装函数
export function install(Vue, options = {}) {
  Vue.component(options.componentName || 'XzxIcon', XzxIcon)
}

// 默认导出
export default {
  install,
  XzxIcon,
  iconData
}

// 获取所有图标名称
export function getIconNames() {
  return Object.keys(iconData)
}
